  if (typeof Lv == "number") SkillLv = SkillLevelName[Lv];
  if (typeof Difficulty == "number") Difficulty = "\n难度：" + SkillLevelName[Difficulty];
  if (typeof Progress == "number") Progress = "\n单次完成度：" + Math.min(99.9, Progress * 100).toFixed(1) + "%";
